  [],\n\t\"revision_timestamp\": \"2015-05-07T03:35:18.175404\",\n\t\"name\": \"production-of-single-walled-carbon-nanotubes-swnt-by-catalytic-disproportionation-of-co-in\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The overall goal of SouthWest Nanotechnologies
  (SWeNT) is thendevelopment of superior technology for the large-scale manufacturing
  andnmarketing of nanotubes of unique quality for near-term specialtynapplications.
  \ The Phase I of this SBIR focused in demonstrating thatnSWeNT's process can be
  scaled-up to a continuous-mode operation.  In thencommercialization aspects, the
  company focused on developing strongnpartnerships with companies such as Dupont,
  ChevronPhillips, GeneralnElectric, Applied Nanotechnologies Inc., and Nomadics,
  who will usennanotubes for their end-products.   The low operating costs andnscalability
  of the SWeNT's process, coupled with its versatility fornproducing nanotubes with
  tailored structure are attractivencharacteristics that may make this technology
  the preferred mode ofnnanotube production.  The expertise developed at SWeNT may
  position thencompany in a leading role in the field of nanotube-based materials.
  Tonconsolidate the technology and boost the commercialization of SWeNT'snproducts,
  phase 2 includes the expansion of the nanotube productionncapabilities and the development
  of applications to take advantage ofnthe uniqueness of the SWeNT's process for tailoring
  nanotubes for eachnspecific application.  The targeted applications are directly
  relevantnto NASA's stated goals and include structural and conducting composites,nfuel
  cells, microelectronic parts, and field emission devices.\",\n\t\"license_title\":
